    return(
      <div class="cssProgress">
        <div class="progress1">
          <div class="cssProgress-bar" data-percent="75" style={{transition: 'none 0s ease 0s', width: '75%'}}> <span class="cssProgress-label">75%</span> </div>
        </div>
      </div>

    )
  }
}
